<p>Write, Run &amp; Share MySQL queries online using OneCompiler's MySQL online editor and compiler for free. It's one of the robust, feature-rich online editor and compiler for MySQL. Getting started with the OneCompiler's MySQL editor is really simple and pretty fast. The editor shows sample boilerplate code when you choose language as 'MySQL' and start writing queries to learn and test online without worrying about tedious process of installation.</p>
<h1>About MySQL</h1>
<p>MySQL is a open-source, free and very popular relational database management system which is developed, distributed and supported by Oracle corporation.</p>
<h3>Key Features:</h3>
<ul>
<li>Open-source relational database management systems.</li>
<li>Reliable, very fast and easy to use database server.</li>
<li>Works on client-server model.</li>
<li>Highly Secure and Scalable</li>
<li>High Performance</li>
<li>High productivity as it uses stored procedures, triggers, views to write a highly productive code.</li>
<li>Supports large databases efficiently.</li>
<li>Supports many operating systems like Linux*,CentOS*, Solaris*,Ubuntu*,Windows*, MacOS*,FreeBSD* and others.</li>
</ul>
<h1>Syntax help</h1>
<h2>Commands</h2>
<h3>1. CREATE</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">CREATE</span> <span class="hljs-keyword">TABLE</span> table_name (
                column1 datatype,
                column2 datatype,
                ....);
</code></pre>
<h3>Example</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">CREATE</span> <span class="hljs-keyword">TABLE</span> EMPLOYEE (
  empId <span class="hljs-type">INTEGER</span> <span class="hljs-keyword">PRIMARY</span> KEY,
  name TEXT <span class="hljs-keyword">NOT</span> <span class="hljs-keyword">NULL</span>,
  dept TEXT <span class="hljs-keyword">NOT</span> <span class="hljs-keyword">NULL</span>
);
</code></pre>
<h3>2. ALTER</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">ALTER</span> <span class="hljs-keyword">TABLE</span> Table_name <span class="hljs-keyword">ADD</span> column_name datatype;
</code></pre>
<h3>Example</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">INSERT</span> <span class="hljs-keyword">INTO</span> EMPLOYEE <span class="hljs-keyword">VALUES</span> (<span class="hljs-number">0001</span>, <span class="hljs-string">'Dave'</span>, <span class="hljs-string">'Sales'</span>);
</code></pre>
<h3>3. TRUNCATE</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">TRUNCATE</span> <span class="hljs-keyword">table</span> table_name;
</code></pre>
<h3>4. DROP</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">DROP</span> <span class="hljs-keyword">TABLE</span> table_name;
</code></pre>
<h3>5. RENAME</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]">RENAME <span class="hljs-keyword">TABLE</span> table_name1 <span class="hljs-keyword">to</span> new_table_name1;
</code></pre>
<h3>6. COMMENT</h3>
<h3>Single-Line Comments:</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"> <span class="hljs-comment">--Line1;</span>
</code></pre>
<h3>Multi-Line comments:</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]">   <span class="hljs-comment">/* Line1,
   Line2 */</span>
</code></pre>
<h2>DML Commands</h2>
<h3>1. INSERT</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">INSERT</span> <span class="hljs-keyword">INTO</span> table_name (column1, column2, column3, ...) <span class="hljs-keyword">VALUES</span> (value1, value2, value3, ...);
</code></pre>
<p>Note: Column names are optional.</p>
<h3>Example</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">INSERT</span> <span class="hljs-keyword">INTO</span> EMPLOYEE <span class="hljs-keyword">VALUES</span> (<span class="hljs-number">0001</span>, <span class="hljs-string">'Ava'</span>, <span class="hljs-string">'Sales'</span>);
</code></pre>
<h3>2. SELECT</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">SELECT</span> column1, column2, ...
<span class="hljs-keyword">FROM</span> table_name
[<span class="hljs-keyword">where</span> <span class="hljs-keyword">condition</span>];
</code></pre>
<h3>Example</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">SELECT</span> <span class="hljs-operator">*</span> <span class="hljs-keyword">FROM</span> EMPLOYEE <span class="hljs-keyword">where</span> dept <span class="hljs-operator">=</span><span class="hljs-string">'sales'</span>;
</code></pre>
<h3>3. UPDATE</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]">UPDATE table_name
<span class="hljs-keyword">SET</span> column1 <span class="hljs-operator">=</span> value1, column2 <span class="hljs-operator">=</span> value2, ...
<span class="hljs-keyword">WHERE</span> <span class="hljs-keyword">condition</span>;
</code></pre>
<h3>Example</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]">UPDATE EMPLOYEE <span class="hljs-keyword">SET</span> dept <span class="hljs-operator">=</span> <span class="hljs-string">'Sales'</span> <span class="hljs-keyword">WHERE</span> empId<span class="hljs-operator">=</span><span class="hljs-string">'0001'</span>;
</code></pre>
<h3>4. DELETE</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">DELETE</span> <span class="hljs-keyword">FROM</span> table_name <span class="hljs-keyword">where</span> <span class="hljs-keyword">condition</span>;
</code></pre>
<h3>Example</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">DELETE</span> <span class="hljs-keyword">from</span> EMPLOYEE <span class="hljs-keyword">where</span> empId<span class="hljs-operator">=</span><span class="hljs-string">'0001'</span>;
</code></pre>
<h2>Indexes</h2>
<h3>1. CREATE INDEX</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]">  <span class="hljs-keyword">CREATE</span> INDEX index_name <span class="hljs-keyword">on</span> table_name(column_name);
</code></pre>
<ul>
<li>To Create Unique index:</li>
</ul>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]">  <span class="hljs-keyword">CREATE</span> <span class="hljs-keyword">UNIQUE</span> INDEX index_name <span class="hljs-keyword">on</span> table_name(column_name);
</code></pre>
<h3>2. DROP INDEX</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">DROP</span> INDEX index_name <span class="hljs-keyword">ON</span> table_name;
</code></pre>
<h2>Views</h2>
<h3>1. Create a View</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]">Creating a <span class="hljs-keyword">View</span>:
<span class="hljs-keyword">CREATE</span> <span class="hljs-keyword">VIEW</span> View_name <span class="hljs-keyword">AS</span>
Query;
</code></pre>
<h3>2. How to call view</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">SELECT</span> <span class="hljs-operator">*</span> <span class="hljs-keyword">FROM</span> View_name;
</code></pre>
<h3>3. Altering a View</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">ALTER</span> <span class="hljs-keyword">View</span> View_name <span class="hljs-keyword">AS</span>
Query;
</code></pre>
<h3>4. Deleting a View</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">DROP</span> <span class="hljs-keyword">VIEW</span> View_name;
</code></pre>
<h2>Triggers</h2>
<h3>1. Create a Trigger</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">CREATE</span> <span class="hljs-keyword">TRIGGER</span> trigger_name trigger_time trigger_event
    <span class="hljs-keyword">ON</span> tbl_name <span class="hljs-keyword">FOR</span> <span class="hljs-keyword">EACH</span> <span class="hljs-type">ROW</span> [trigger_order] trigger_body
<span class="hljs-comment">/* where
trigger_time: { BEFORE | AFTER }
trigger_event: { INSERT | UPDATE | DELETE }
trigger_order: { FOLLOWS | PRECEDES } */</span>
</code></pre>
<h3>2. Drop a Trigger</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">DROP</span> <span class="hljs-keyword">TRIGGER</span> [IF <span class="hljs-keyword">EXISTS</span>] trigger_name;
</code></pre>
<h2>Stored Procedures</h2>
<h3>1. Create a Stored Procedure</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">CREATE</span> <span class="hljs-keyword">PROCEDURE</span> sp_name(p1 datatype)
<span class="hljs-keyword">BEGIN</span>
<span class="hljs-comment">/*Stored procedure code*/</span>
<span class="hljs-keyword">END</span>;
</code></pre>
<h3>2. How to call Stored procedure</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">CALL</span> sp_name;
</code></pre>
<h3>3. How to delete stored procedure</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">DROP</span> <span class="hljs-keyword">PROCEDURE</span> sp_name;
</code></pre>
<h2>Joins</h2>
<h3>1. INNER JOIN</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">SELECT</span> <span class="hljs-operator">*</span> <span class="hljs-keyword">FROM</span> TABLE1 <span class="hljs-keyword">INNER</span> <span class="hljs-keyword">JOIN</span> TABLE2 <span class="hljs-keyword">where</span> <span class="hljs-keyword">condition</span>;
</code></pre>
<h3>2. LEFT JOIN</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">SELECT</span> <span class="hljs-operator">*</span> <span class="hljs-keyword">FROM</span> TABLE1 <span class="hljs-keyword">LEFT</span> <span class="hljs-keyword">JOIN</span> TABLE2 <span class="hljs-keyword">ON</span> <span class="hljs-keyword">condition</span>;
</code></pre>
<h3>3. RIGHT JOIN</h3>
<pre style="background-color: rgb(245, 245, 245); padding: 12px; border-radius: 4px; overflow-x: auto;"><code class="sql hljs" node="[object Object]"><span class="hljs-keyword">SELECT</span> <span class="hljs-operator">*</span> <span class="hljs-keyword">FROM</span> TABLE1 <span class="hljs-keyword">RIGHT</span> <span class="hljs-keyword">JOIN</span> TABLE2 <span class="hljs-keyword">ON</span> <span class="hljs-keyword">condition</span>;
</code></pre>
